export default (function(a,b,c,d,e,f,g,h){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:f,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:b,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:b,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:b,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:f,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:5}}},bXJRwwhqtz:{data:{id:1148,attributes:{imdbId:"tt4103724",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMjAwNTA5NTYyNl5BMl5BanBnXkFtZTgwMDIzMzA2MzI@._V1_SX300.jpg",type:b,ratings:[{Source:"Internet Movie Database",Value:"6.7\u002F10"},{Source:"Rotten Tomatoes",Value:"24%"},{Source:"Metacritic",Value:"36\u002F100"}],item_lang:{data:{id:1811,attributes:{title:e,plot:"In Saint Augustine, Louisiana, Josie is left at the altar by her fiance Liam. Eight years later, Liam is a successful country singer. The day after a concert in New Orleans, Liam learns that Mason, one of his groomsmen from the wedding, has been killed in a car accident. Liam returns to St. Augustine and attends Mason's funeral. Although Liam attempts to be discreet, Josie recognizes him. After Mason's burial, Josie approaches Liam and punches him in the stomach. Liam stays with his father, Pastor Brian, although his father is bitter that Liam never kept in contact after becoming famous..",slug:"forever-my-girl"}}},books:{data:[{id:6467,attributes:{title:e,description:"I was never supposed to be a rock star. I had my life all planned out for me. Play football in college. Go to the NFL. Marry my high school sweetheart and live happily ever after. I broke both our hearts that day when I told her I was leaving. I was young. I made the right decision for me, but the wrong decision for us. I've poured my soul into my music, but I've never forgotten her. Her smell, her smile. And now I'm going back. After ten years. I hope I can explain that after all this time. I still want her to be my forever girl.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=7N2uzQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[c],firstBook:true,published:"2017-10-11",publisher:a,subtitle:a}},{id:6468,attributes:{title:e,description:"FOREVER MY GIRL will release in theaters January 2018I was never supposed to be a rock star. I had my life all planned out for me. Play football in college. Go to the NFL. Marry my high school sweetheart and live happily ever after. I broke both our hearts that day when I told her I was leaving. I was young. I made the right decision for me, but the wrong decision for us. I've poured my soul into my music, but I've never forgotten her. Her smell, her smile. And now I'm going back. After ten years. I hope I can explain that after all this time. I still want her to be my forever girl.",thumbnail:a,authors:[h],firstBook:d,published:"2017-09-21",publisher:a,subtitle:a}},{id:6469,attributes:{title:"The Beaumont Series (Books 1-3)",description:"FOREVER MY GIRL, a novel about Rock star Liam Page who, through tragic circumstances, is given a second chance at righting the wrongs he made when he left the one who owned his heart. A story of redemption, forgiveness, and never forgetting your one true love. ONE NIGHT WITH HARRISON, a novella that introduces us to a young Harrison James and what happens when a meet and greet with some fans turns into something far bigger than he ever anticipated MY UNEXPECTED FOREVER, a novel that finds two families torn apart for different reasons, one is dealing with heartache and loss, the other is trying to find acceptance. Join them in this story as they come together against all the odds to find the happiness they deserve. FINDING MY FOREVER, a novel, which tells the true meaning of love. Sacrifice, trust, devotion and taking chances all play keys roles in this story of how two people come together while dealing with a threat that could ruin their lives forever.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=a458swEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[h],firstBook:d,published:"2017-10-01",publisher:"Createspace Independent Publishing Platform",subtitle:a}},{id:6470,attributes:{title:"Forever Mason",description:"Mason Powell. Best friend. Boyfriend. Husband. Father. He’s the young man you know but have never met. He’s the man who chose love over friendship. He’s the man who would do anything for his family and friends. He’s the man who stepped up when someone wasn’t there. He’s the man who has a story to tell. Be there when Mason tells his life story. Be there when Mason falls in love with Katelyn. Be there when Mason makes the fateful decision that ends his friendship with Liam Westbury. Be there when his life changes forever. Be there when . . .",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=UJBWEAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[c],firstBook:d,published:"2021-12-27",publisher:c,subtitle:a}},{id:6471,attributes:{title:"A Date with an Admirer",description:"New York Times and USA Today bestselling authors Heidi McLaughlin and L.P. Dover come together for a sexy new series that delivers romance for every season! February is the month of love, but not for Sophie. One week before Valentine’s Day, she learns her boyfriend of two years has been cheating on her with one of his dental hygienists. As much as she wants to erase any trace of him from her life, she has no choice but to face him and his new squeeze at a huge Valentine’s Day bash that has fast become the social event of the season. No way is she going alone. What she needs is a beautiful hunk of arm candy... STAT. Sophie’s best friend, Ellie, proposes the perfect solution to her dilemma. Her brother Tanner, the smokin’ hot surfer, just got back into town and is more than happy to help Sophie prove she’s over her scumbag ex. What starts as an act between Sophie and Tanner quickly swells into more. It doesn’t take long before Sophie finds herself wanting to ride more than just waves with the toned and tanned hottie. But when passion crashes over the pair, Sophie fears she’s putting her friendship with Ellie at risk. Can Tanner convince her to give their love a chance? Or will the bonds of friendship repel Cupid’s arrow?",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=tX05EAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:["L.P. Dover",c],firstBook:d,published:"2021-07-21",publisher:"Books by L.P. Dover, LLC",subtitle:a}}]}}},meta:{}}},prerenderedAt:1681309494252}}("","movie","Heidi McLaughlin",null,"Forever My Girl","series",1,"Heidi McLaughlin (Romance fiction writer)"))